    false,nt"url": null,nt"notes": "The Sustainable Communities Regional Planning
    (SCRP) Grant Program supports locally-led collaborative efforts that bring together
    diverse interests from the many municipalities in a region to determine how best
    to target housing, economic and workforce development, and infrastructure investments
    to create more jobs and regional economic activity. The Program places a priority
    on investing in partnerships, including nontraditional partnerships (e.g., arts
    and culture, recreation, public health, food systems, regional planning agencies
    and public education entities) that translate the six Livability Principles into
    strategies that direct long-term development and reinvestment, demonstrate a commitment
    to addressing issues of regional significance, use data to set and monitor progress
    toward performance goals, and engage stakeholders and residents in meaningful decision-making
    roles. The SCRP program is a key initiative of the Partnership for Sustainable Communities,
    in which HUD works with the U.S. Department of Transportation (DOT) and the U.S.
    Environmental Protection Agency (EPA) to coordinate and leverage programs and investments.",nt"license_title":
